import React from 'react';
import ayungonLogo from '../assets/ayungonLogo';
const Officials = () => {
	return (
		<div>
			<div className="flex flex-col">
				<div>
					<img
						src={ayungonLogo}
						alt="Ayungon Logo"
					/>
				</div>
				<div className="flex justify-center pt-5 font-Cinzel font-bold text-4xl flex-col items-center">
					<h1>Municipality Of Ayungon</h1>

					<h1>Officials</h1>
				</div>
			</div>
		</div>
	);
};

export default Officials;
